package main

import (
	"errors"
	"fmt"
	"path/filepath"
	"regexp"
	"strings"
)

func main() {
	text:=`<p><img class="wscnph" src="data:image/png;base64," />hjhjhgjhgjh"data:image/png;base64,"</p>`
	text = `<p><img class="wscnph" src="data:image/png;base64,fasd==fsdf/fasdf=" /> <img class="wscnph" src="data:image/png;base64,fasdfsd==f/dddd==" /><img class="wscnph" src="data:image/png;base64,fasdfsdf/qqqq==" />`
	//	//	//fmt.Println(str)
	//text := `Hello World! Helo world`
	// 正则标记“非贪婪模式”(?U)
	reg := regexp.MustCompile(`data:\s*image\/(\w+);base64,[\w\d+/=]*[=|==]`)
	//reg := regexp.MustCompile(`H[\w]+o`)
	fmt.Printf("%q\n", reg.FindAllString(text,-1)) // Hello
}

func GetCurrentPath() (string, error) {
	//file, err := exec.LookPath(os.Args[0])
	//if err != nil {
	//	return "", err
	//}
	path, err := filepath.Abs("")
	fmt.Println(path)
	if err != nil {
		return "", err
	}
	i := strings.LastIndex(path, "/")
	if i < 0 {
		i = strings.LastIndex(path, "\\")
	}
	if i < 0 {
		return "", errors.New(`error: Can't find "/" or "\".`)
	}
	return string(path[0 : i+1]), nil
}